import BlogPreview from '../components/BlogPreview';

import { useEffect, useState } from 'react';
const Blogs = () => {
  const [posts, setPosts] = useState([]);
  useEffect(() => {
    fetch(
      'postgresql://db:bk40n09sx16kcwmn@app-949d4cba-475e-4c7e-a809-38b8dc2a9505-do-user-8494246-0.b.db.ondigitalocean.com:25060/db?sslmode=require'
    )
      .then((response) => response.json())
      .then((data) => console.log(data))
      .then((data) => setPosts(data));
  }, []);

  return (
    <div className='home'>
      <div className='top-rated grid grid-cols-1 gap-8 justify-items-center'>
        {posts.map((post) => (
          <BlogPreview post={post} key={post.id} />
        ))}
      </div>
    </div>
  );
};

export default Blogs;
